import React from 'react'
import panner from './panner.jpg'

const Paneer = () => {
    const pann={height:'700px'}
  return (
    <div>
      <h1>Paneer</h1>
      <img src={panner}style={pann}></img>
    </div>
  )
}

export default Paneer
